import React from 'react';
import Header from "../Header";
import Footer from "../Footer";

const Map = () => {
    return (
        <div>
            <Header/>
            <iframe className="Map" src="https://www.google.com/maps/d/embed?mid=14TaonPkOlJyziG2HBBmH6b8uaiaBaro&ehbc=2E312F" width="640" height="480"></iframe>
            <Footer/>
        </div>
    );
};

export default Map;
